    display: "flex",
    alignItems: "center",
  });

  const aboutLink = document.createElement("a");
  aboutLink.href = "#about";
  aboutLink.textContent = "About us";
  groupLeft.appendChild(aboutLink);

  const testLink = document.createElement("a");
  testLink.href = "#test";
  testLink.textContent = "Test";
  groupLeft.appendChild(testLink);

  navLinks.appendChild(groupLeft);

  // 오른쪽 링크 그룹
  const groupRight = document.createElement("div");
  groupRight.className = "group-right";
  Object.assign(groupRight.style, {
    display: "flex",
    alignItems: "center",
    marginLeft: "50px",
  });

  const signUpLink = document.createElement("a");
  signUpLink.href = "#sign-up";
  signUpLink.textContent = "Sign up";
  groupRight.appendChild(signUpLink);

  const loginButton = document.createElement("a");
  loginButton.href = "#login";
  loginButton.textContent = "Login";
  Object.assign(loginButton.style, {
    backgroundColor: "white",
    color: "black",
    padding: "8px 40px",
    borderRadius: "10px",
    fontSize: "16px",
    fontWeight: "bold",
    textDecoration: "none",
  });
