    loginButton.style.backgroundColor = "#e5c200";
  });
  loginButton.addEventListener("mouseleave", () => {
    loginButton.style.backgroundColor = "white";
  });

  groupRight.appendChild(loginButton);
  navLinks.appendChild(groupRight);
  navbar.appendChild(navLinks);
  document.body.appendChild(navbar);

  // 메인 콘텐츠 생성
  const mainContent = document.createElement("div");
  mainContent.className = "main-content-01";
  Object.assign(mainContent.style, {
    backgroundColor: "#05472b",
    padding: "100px 360px",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    gap: "200px",
    marginRight: "0",
  });

  // 이미지 섹션 생성
  const mainImg = document.createElement("div");
  mainImg.className = "main-img";
  Object.assign(mainImg.style, {
    position: "relative",
    flex: "0.8",
    overflow: "hidden",
  });

  const mainImage = document.createElement("img");
  mainImage.id = "main-image";
  mainImage.src = "/img/main_img_01.png";
  mainImage.alt = "일상 회화 관련 이미지";
  Object.assign(mainImage.style, {
    width: "100%",
    height: "auto",
    filter: "brightness(0.6) contrast(1.2)",
  });

  const overlayText = document.createElement("div");
  overlayText.className = "overlay-text";
  Object.assign(overlayText.style, {
    position: "absolute",
    bottom: "10%",
    left: "7%",
    color: "white",
    textAlign: "left",
    zIndex: "10",
  });

  const overlayTitle = document.createElement("div");
  overlayTitle.className = "overlay-title-text";
  overlayTitle.textContent = "일상 회화";
  Object.assign(overlayTitle.style, {
    fontSize: "70px",
    fontWeight: "bold",
  });

  const overlaySubtitle = document.createElement("div");
  overlaySubtitle.className = "overlay-subtext";
  overlaySubtitle.textContent = "일상에서 자주 사용하는 짧은 표현과 문장들";
  Object.assign(overlaySubtitle.style, {
    fontSize: "30px",
    marginTop: "10px",
  });

  overlayText.appendChild(overlayTitle);
  overlayText.appendChild(overlaySubtitle);
  mainImg.appendChild(mainImage);
  mainImg.appendChild(overlayText);
  mainContent.appendChild(mainImg);

  document.body.appendChild(mainContent);
});
